def larger_numberer(number1, number2, number3):    """        Parameters    ----------    number1 : integer        DESCRIPTION.    number2 : integer        DESCRIPTION.    number3 : integer        eng katta bo'lgan sonni qaytaradi.    Returns    -------    the biggest number among given digits.    """    number1=int(number1)    number2=int(number2)    number3=int(number3)    if number1>number2 and number1>number3:        print(number1)    elif number2>number1 and number2>number3:        print(number2)    else:        print(number3)            